import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
        <Header />
        <Router>
          <Routes>
            <Route path='/' element={<Home />}/>
          </Routes>
        </Router>
        <Footer />
    </div>
  );
}

export default App;
